import React, { useState, useEffect } from 'react'
import request from '../../utils/request'


function Dashboard() {
  let [state, setState] = useState([])
  let [loadStatus, setLoadStatus] = useState(-1)
  let [x_axisState, set_x_axisState] = useState([])
  let [y_axisState, set_y_axisState] = useState([])
  let [networkXAxis, setNetworkXAxis] = useState([])
  let [networkYAxis, setNetworkYAxis] = useState([])
  let [doughNutNetwork, setdoughNutNetwork] = useState([])
  let [doughNutDlt , setdoughNutDlt] = useState([])
  let [doughNutNetworkCount , setdoughNutNetworkCount] = useState([])
  let [pieCloud, setPieCloud] = useState([])
  let [pieCloudCount, setPieCloudCount] = useState([])
  var dltArray =[]
  var networkArray =[]

  var cloudArray = []
  var cloudCountArray = []

  useEffect(() => {
    request('GET', '/auth/getUserCount', {}).then(res => {
        request('GET', '/auth/getnetworksCloud', {}).then(doughnutData =>{
          console.log('<vvvvvvvvdoughnutData.data.getNetworkCount', doughnutData)
          if (res.data.success) {
            setState(res.data);
            let graphData = getGraphData(res.data.graph_count);
            let networkData = getNetworkData(res.data.networkCount);
            setdoughNutNetwork(doughnutData.data.getNetworkCount.data)
            set_x_axisState(graphData.x_axis_data);
            set_y_axisState(graphData.y_axis_data);
            setNetworkXAxis(networkData.xAxisNetwork);
            setNetworkYAxis(networkData.yAxisNetwork);
            setLoadStatus(1);
          }
          if(doughnutData.data.getNetworkCount.success){
            console.log('MMMMMMcccccccccMMM', doughnutData.data.getNetworkCount)
            doughnutData.data.getNetworkCount.data.map((countData,index)=>{
             dltArray.push(getDlt(countData.dlt))
             networkArray.push(countData.network_count)
           })
           setdoughNutDlt([...dltArray])
           setdoughNutNetworkCount([...networkArray])
          }
          if(doughnutData.data.getUserCloudCount.success) {
            doughnutData.data.getUserCloudCount.data.map(item => {
              debugger
              if(item.aws_count){
                cloudArray.push('AWS');
                cloudCountArray.push(item.aws_count);
              }
              if(item.azure_count){
                cloudArray.push('Azure');
                cloudCountArray.push(item.azure_count);
              }
              if(item.do_count){
                cloudArray.push('Digital Ocean');
                cloudCountArray.push(item.do_count);
              }
              if(item.google_count){
                cloudArray.push('Google Cloud');
                cloudCountArray.push(item.google_count);
              }
              if(item.ibm_count){
                cloudArray.push('IBM');
                cloudCountArray.push(item.ibm_count);
              }
            })
            setPieCloud([...cloudArray]);
            setPieCloudCount([...cloudCountArray]);
          }
      })
    })
  }, [setState])

  // console.log("doughNutCloud",doughNutCloud, "doughNutCloudCount", doughNutCloudCount)
  // console.log("doughNutDlt",doughNutDlt, "doughNutCloudCount", doughNutCloudCount)

   function getDlt(dlt){
     switch(dlt){
       case 1:
       return 'Sawtooth';
       case 2:
       return 'Fabric';
       case 3:
       return 'Ethereum';
       case 5:
       return 'Credits';
       case 6:
       return 'Corda';
       case 7:
       return 'Fluree';
       default:
        return null;
     }
   }

  console.log('nnnnnnnnnnn',doughNutDlt)
  console.log('doughNutNetworkCount',doughNutNetworkCount)
  return (<>
    <Header />
    <SideNav />
    <main>
      <Block state={state} />
      <div className="loading-profile" style={{ display: loadStatus < 1 ? 'row' : 'none' }}>
        <img src="/static/images/pending-loader.svg" alt="Loading..." className="pending-loader" width="50" />
      </div>
      <div className="row">
          <Grid pieCloud={pieCloud} pieCloudCount={pieCloudCount} />
          <div className="col-xl-6 col-md-12 mt-3 ">
            <div className="card card-body border-0 col-md-12">
              <UserGraph y_axis_data={y_axisState} x_axis_data={x_axisState} networkXAxis={networkXAxis} networkYAxis={networkYAxis} />
            </div>
            <div className="card card-body mt-2">
              <div className="card border-0 col-md-12">
                <CloudDoughnut doughNutDlt={doughNutDlt} doughNutNetworkCount={doughNutNetworkCount}/>
              </div>
            </div>
          </div>
      </div>
    </main>
  </>
  )
}

export default Dashboard
